import logo from './BugPharma_Logo.png';
import { Component } from 'react';

class App extends Component{
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} /> 
          <p>
            Login Warrior
          </p>
        </header>
      </div>
    );
  }
}

export default App;
